[{"location":"","page":"Home","title":"Home","text":"CurrentModule = ConstrainedPlanarTriangles","category":"page"},{"location":"#ConstrainedPlanarTriangles","page":"Home","title":"ConstrainedPlanarTriangles","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for ConstrainedPlanarTriangles.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Very primitive package for applying elemetary geometry to find to missing angles or sides in a triangle.","category":"page"},{"location":"","page":"Home","title":"Home","text":"The interface is intuitive, the 3 angles are called A, B, C and the sides lengths a, b, c.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Here are some examples:","category":"page"},{"location":"","page":"Home","title":"Home","text":"julia> triangle(C=90, a=3, b=4)\nDict{Symbol, Vector{Union{Missing, Float64}}} with 2 entries:\n  :Sides  => [3.0, 4.0, 5.0]\n  :Angles => [36.8699, 53.1301, 90.0]\n\njulia> triangle(C=60, a=4, b=4)\nDict{Symbol, Vector{Union{Missing, Float64}}} with 2 entries:\n  :Sides  => [4.0, 4.0, 4.0]\n  :Angles => [60.0, 60.0, 60.0]\n\njulia> triangle(a=3, b=3, c=3)\nDict{Symbol, Vector{Union{Missing, Float64}}} with 2 entries:\n  :Sides  => [3.0, 3.0, 3.0]\n  :Angles => [60.0, 60.0, 60.0]\n\njulia> triangle(A=30, B=60)\nDict{Symbol, Vector{Union{Missing, Float64}}} with 2 entries:\n  :Sides  => [missing, missing, missing]\n  :Angles => [30.0, 60.0, 90.0]\n","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [ConstrainedPlanarTriangles]","category":"page"}]
